module.exports = "<div id=\"mindfulness\" ng-controller = \"myController as myCtrl\">\n    <form (ngSubmit)=\"saveSurvey()\" id=\"mindForm\">\n        <h1> MINDFULNESS SURVEY</h1>\nThe <a href=\"http://www.mindfulness-extended.nl/content3/wp-content/uploads/2013/07/Freiburg-Mindfulness-Inventory.pdf\" target=\"_blank\">Frieburg Mindfulness Inventory&nbsp;</a><br />\n\n<input [(ngModel)]=\"formData.userName\" name=\"userName\" placeholder=\"Name\" type=\"text\" required/>\n\n        <div class = \"container\">\n            <p class = \"questions\">\n            1. I am opened to the experience of the present moment.\n            </p>\n\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radopenedStart\" name=\"opened\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.opened\"/>\n                <li class=\"likert\"><input name=\"opened\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.opened\"/>\n                <li class=\"likert\"><input name=\"opened\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.opened\"/>\n                <li class=\"likert\"><input name=\"opened\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.opened\"/>\n                <li class=\"likert\"><input id=\"radopenedEnd\" name=\"opened\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.opened\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n            2. I sense my body, whether eating, cooking, cleaning or talking.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radBodyStart\" name=\"body\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.body\"/>\n                <li class=\"likert\"><input name=\"body\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.body\"/>\n                <li class=\"likert\"><input name=\"body\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.body\"/>\n                <li class=\"likert\"><input name=\"body\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.body\">\n                <li class=\"likert\"><input id=\"radBodyEnd\"name=\"body\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.body\"/> Almost Always\n            </ul>\n        </div>\n\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    3. When I notice an absence of mind I gently return to the experience of the here and now.\n            </p>\n\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radReturnStart\" name=\"return\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.returned\"/>\n                <li class=\"likert\"><input name=\"return\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.returned\"/>\n                <li class=\"likert\"><input name=\"return\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.returned\"/>\n                <li class=\"likert\"><input name=\"return\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.returned\">\n                <li class=\"likert\"><input id=\"radReturnEnd\"name=\"return\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.returned\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    4. I am able to appreciate myself.\n            </p>\n\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radAppreciateStart\" name=\"appreciate\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.appreciate\"/>\n                <li class=\"likert\"><input name=\"appreciate\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.appreciate\"/>\n                <li class=\"likert\"><input name=\"appreciate\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.appreciate\"/>\n                <li class=\"likert\"><input name=\"appreciate\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.appreciate\">\n                <li class=\"likert\"><input id=\"radAppreciateEnd\"name=\"appreciate\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.appreciate\"/> Almost Always\n            </ul>\n        </div>\n\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    5. I pay attention to what's behind my actions.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radIntentionsStart\" name=\"intentions\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.intentions\"/>\n                <li class=\"likert\"><input name=\"intentions\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.intentions\"/>\n                <li class=\"likert\"><input name=\"intentions\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.intentions\"/>\n                <li class=\"likert\"><input name=\"intentions\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.intentions\">\n                <li class=\"likert\"><input id=\"radIntentionsEnd\"name=\"intentions\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.intentions\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    6. I see my mistakes and difficulties without judging them.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radnonjudgementStart\" name=\"nonjudgement\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.nonjudgement\"/>\n                <li class=\"likert\"><input name=\"nonjudgement\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.nonjudgement\"/>\n                <li class=\"likert\"><input name=\"nonjudgement\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.nonjudgement\"/>\n                <li class=\"likert\"><input name=\"nonjudgement\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.nonjudgement\">\n                <li class=\"likert\"><input id=\"radnonjudgementEnd\"name=\"intentions\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.nonjudgement\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    7. I feel connected to my experience in the here-and-now.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radConnectedStart\" name=\"connected\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.connected\"/>\n                <li class=\"likert\"><input name=\"connected\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.connected\"/>\n                <li class=\"likert\"><input name=\"connected\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.connected\"/>\n                <li class=\"likert\"><input name=\"connected\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.connected\">\n                <li class=\"likert\"><input id=\"radConnectedEnd\"name=\"connected\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.connected\"/> Almost Always\n            </ul>\n        </div>\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    8. I accept unpleasant experience.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radAcceptanceStart\" name=\"acceptance\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.acceptance\"/>\n                <li class=\"likert\"><input name=\"acceptance\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.acceptance\"/>\n                <li class=\"likert\"><input name=\"acceptance\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.acceptance\"/>\n                <li class=\"likert\"><input name=\"acceptance\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.acceptance\">\n                <li class=\"likert\"><input id=\"radAcceptanceEnd\"name=\"acceptance\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.acceptance\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    9. I am friendly to myself when things go wrong.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radFriendlyStart\" name=\"friendly\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.friendly\"/>\n                <li class=\"likert\"><input name=\"friendly\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.friendly\"/>\n                <li class=\"likert\"><input name=\"friendly\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.friendly\"/>\n                <li class=\"likert\"><input name=\"friendly\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.friendly\">\n                <li class=\"likert\"><input id=\"radFriendlyEnd\"name=\"friendly\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.friendly\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    10. I watch my feelings without getting lost in them.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radWatchfulStart\" name=\"watchful\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.watchful\"/>\n                <li class=\"likert\"><input name=\"watchful\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.watchful\"/>\n                <li class=\"likert\"><input name=\"watchful\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.watchful\"/>\n                <li class=\"likert\"><input name=\"watchful\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.watchful\">\n                <li class=\"likert\"><input id=\"radWatchfulEnd\"name=\"watchful\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.watchful\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    11. In difficult situations, I can pause without immediately reacting.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radPauseStart\" name=\"pause\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.pause\"/>\n                <li class=\"likert\"><input name=\"pause\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.pause\"/>\n                <li class=\"likert\"><input name=\"pause\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.pause\"/>\n                <li class=\"likert\"><input name=\"pause\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.pause\">\n                <li class=\"likert\"><input id=\"radPauseEnd\"name=\"pause\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.pause\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    12. I experience moments of inner peace and ease even when things get hectic and stressful.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radPeaceStart\" name=\"peace\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.peace\"/>\n                <li class=\"likert\"><input name=\"peace\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.peace\"/>\n                <li class=\"likert\"><input name=\"peace\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.peace\"/>\n                <li class=\"likert\"><input name=\"peace\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.peace\">\n                <li class=\"likert\"><input id=\"radPeaceEnd\"name=\"peace\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.peace\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"container\">\n            <p class = \"questions\">\n    13. I am patient with myself and others.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radPatientStart\" name=\"patient\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.patient\"/>\n                <li class=\"likert\"><input name=\"patient\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.patient\"/>\n                <li class=\"likert\"><input name=\"patient\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.patient\"/>\n                <li class=\"likert\"><input name=\"patient\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.patient\">\n                <li class=\"likert\"><input id=\"radPatientEnd\"name=\"patient\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.patient\"/> Almost Always\n            </ul>\n        </div>\n\n        <div class = \"lightContainer\">\n            <p class = \"questions\">\n    14. I am able to smile when I notice how I sometimes make life difficult.\n            </p>\n            <ul class=\"likert\">\n                <li class=\"likert\">Rarely<input required id=\"radSmileStart\" name=\"smile\" type=\"radio\" value=\"1\" [(ngModel)]=\"formData.smile\"/>\n                <li class=\"likert\"><input name=\"smile\" type=\"radio\" value=\"2\" [(ngModel)]=\"formData.smile\"/>\n                <li class=\"likert\"><input name=\"smile\" type=\"radio\" value=\"3\" [(ngModel)]=\"formData.smile\"/>\n                <li class=\"likert\"><input name=\"smile\" type=\"radio\" value=\"4\" [(ngModel)]=\"formData.smile\">\n                <li class=\"likert\"><input id=\"radSmileEnd\"name=\"smile\" type=\"radio\" value=\"5\" [(ngModel)]=\"formData.smile\"/> Almost Always\n            </ul>\n        </div>\n\n        {{success}}\n        <div class=\"savebutton\" [hidden]=\"isSuccess\">\n            <input type=\"submit\" value=\"Submit\"/>\n        </div>\n    <br /><br />\n\n</form>\n\n</div>"

